import { useState } from "react";
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import { useNavigate } from "react-router-dom"

export function Personcreate(props) {
    const [Person, setPerson] = useState({});
    let navigate = useNavigate();
    const handleChange = (event) => {
        const name = event.target.name;
        const value = event.target.value;
        setPerson(values => ({ ...values, [name]: value }))
    }
    const handleSubmit = (event) => {
        let demo = JSON.stringify(Person);
        console.log(JSON.parse(demo));
        fetch("http://localhost:8081/person", {
            method: 'POST',
            headers: { 'Content-type': 'application/json' },
            body: demo
        })
        event.preventDefault();
        navigate('/ListPerson');
        alert(Person);
    }
    return (
      <div className="enquiry-form">
      <h1>Enquiry Form</h1>
      <Form onSubmit={handleSubmit}>
        <Form.Group controlId="enquirerName">
          <Form.Label>Enquirer Name:</Form.Label>
          <Form.Control onChange={handleChange} type="text" placeholder="Enter enquirer name" />
        </Form.Group>
        <Form.Group controlId="enquirerAddress">
          <Form.Label>Enquirer Address:</Form.Label>
          <Form.Control onChange={handleChange} type="text" placeholder="Enter enquirer address" />
        </Form.Group>
        <Form.Group controlId="enquirerMobile">
          <Form.Label>Enquirer Mobile:</Form.Label>
          <Form.Control onChange={handleChange} type="text" placeholder="Enter enquirer mobile" />
        </Form.Group>
        <Form.Group controlId="enquirerEmail">
          <Form.Label>Enquirer Email:</Form.Label>
          <Form.Control onChange={handleChange} type="email" placeholder="Enter enquirer email" />
        </Form.Group>
        <Form.Group controlId="enquirerQuery">
          <Form.Label>Enquirer Query:</Form.Label>
          <Form.Control onChange={handleChange} as="textarea" rows={3} />
        </Form.Group>
        <Form.Group controlId="closureReasonId">
          <Form.Label>Closure Reason ID:</Form.Label>
          <Form.Control onChange={handleChange} type="text" placeholder="Enter closure reason ID" />
        </Form.Group>
        <Form.Group controlId="closureReason">
          <Form.Label>Closure Reason:</Form.Label>
          <Form.Control type="text" placeholder="Enter closure reason" />
        </Form.Group>
        <Form.Group controlId="enquiryProcessedFlag">
          <Form.Check type="checkbox" label="Enquiry Processed" />
        </Form.Group>
        <Form.Group controlId="studentName">
          <Form.Label>Student Name:</Form.Label>
          <Form.Control type="text" placeholder="Enter student name" />
        </Form.Group>
        <Form.Group controlId="inquiryCounter">
          <Form.Label>Inquiry Counter:</Form.Label>
          <Form.Control type="number" placeholder="Enter inquiry counter" />
        </Form.Group>
        <br></br>
        <Button variant="primary" type="submit">
          Submit
        </Button>
      </Form>
    </div>
    );
} 
export default Personcreate;
